(56, 12, 1, 'werwe|Enabled|None|Benetton Blu|Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?|Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?|1015|1'),
(57, 13, 1, 'werew|Enabled|None|Benetton Blu3|Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?|Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?|1015|1'),
(55, 11, 1, 'adwee|Enabled|Taxable Goods|Davidoff Cool Water 2|Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Men''s edition Davidoff Cool Water Into The Ocean for Men has been announced as fresh and aromatic, with accentuated sea accords. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Women''s edition Davidoff Cool Water Into The Ocean for Women highlights a floral-fruity blend refreshed with herbal notes. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Top notes await us with sea wave combined with citrusy zest of mandarin and luminous grapefruit. The heart incorporates sage and basil, leading to juniper in the base of the fragrance.|Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Men''s edition Davidoff Cool Water Into The Ocean for Men has been announced as fresh and aromatic, with accentuated sea accords. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Women''s edition Davidoff Cool Water Into The Ocean for Women highlights a floral-fruity blend refreshed with herbal notes. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Top notes await us with sea wave combined with citrusy zest of mandarin and luminous grapefruit. The heart incorporates sage and basil, leading to juniper in the base of the fragrance.|1000|1'),
(54, 10, 1, 'sdfs|Enabled|Taxable Goods|Davidoff Cool Water|Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Men''s edition Davidoff Cool Water Into The Ocean for Men has been announced as fresh and aromatic, with accentuated sea accords. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Women''s edition Davidoff Cool Water Into The Ocean for Women highlights a floral-fruity blend refreshed with herbal notes. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Top notes await us with sea wave combined with citrusy zest of mandarin and luminous grapefruit. The heart incorporates sage and basil, leading to juniper in the base of the fragrance.|Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Men''s edition Davidoff Cool Water Into The Ocean for Men has been announced as fresh and aromatic, with accentuated sea accords. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Women''s edition Davidoff Cool Water Into The Ocean for Women highlights a floral-fruity blend refreshed with herbal notes. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Top notes await us with sea wave combined with citrusy zest of mandarin and luminous grapefruit. The heart incorporates sage and basil, leading to juniper in the base of the fragrance.|1000|1'),
(53, 9, 1, 'hsjk|Enabled|None|Nike Fission|Key Features Blend of Cardamom, Elemi and Musk Spicy, Fruity and Floral Scent Strong and Refreshing Catching the fancy of a man with refined tastes, allowing his exuberant self to be crowned preeminent even as he serves a nine hour shift like everyone else is this Nike Fission EDT. Spicy, Fruity and Floral Scent Shy yet assertive, the perfect swing of a mix that presents notes so spicy, fruity and floral so the EDT opens just as an undertone to your powerful nature. Strong and Refreshing Your need to be perfect and unique is quite a fresh breath just like the fragrance you wear because Nike’s mass premium comes from renowned perfumers to complement the best side in every man. Blend of Cardamom, Elemi and Musk The impeccability of the delicate opening lands on a bed of warm and intense musk blended with elemi and cardamom so even if people aren’t aware when you enter, their senses will know what you leave behind.|Key Features Blend of Cardamom, Elemi and Musk Spicy, Fruity and Floral Scent Strong and Refreshing Catching the fancy of a man with refined tastes, allowing his exuberant self to be crowned preeminent even as he serves a nine hour shift like everyone else is this Nike Fission EDT. Spicy, Fruity and Floral Scent Shy yet assertive, the perfect swing of a mix that presents notes so spicy, fruity and floral so the EDT opens just as an undertone to your powerful nature. Strong and Refreshing Your need to be perfect and unique is quite a fresh breath just like the fragrance you wear because Nike’s mass premium comes from renowned perfumers to complement the best side in every man. Blend of Cardamom, Elemi and Musk The impeccability of the delicate opening lands on a bed of warm and intense musk blended with elemi and cardamom so even if people aren’t aware when you enter, their senses will know what you leave behind.|786|1'),
(51, 7, 1, 'adee|Enabled|None|Davidoff Silver|Key Features Elegantly Simple Masculine Fragrance Oriental Woody Fragrance Intense and Pungent Scent of Saffron Fresh and Incisive Bitter Orange Scent Sensual Warmth of Rich Amber Bringing forth a burst of flavour into your life in a refreshing, invigorating way that adds an edge to your masculine persona, Silver Shadow from Davidoff is the perfect fragrance for the man who stands out without trying to. Elegantly Simple The Eau de Toilette brings a sheen of elegance while wrapping you up in an aura of masculine simplicity that lasts a long while. Oriental Woody Fragrance A little spicy, a little edgy and a whole lot of deep dark tones constitute this perfume. Sensual and Warm With tones of resinous amber that adds depth and warmth to the concoction, the fragrance accentuates the latent sensuality that is primal. Intense and Pungent The simplicity of saffron adds to the mixture a flavour that is far from frivolous. Fresh and Incisive The notes also contain bitter orange that is fresh and refreshing, lifting up sagging spirits.|FRAGRANCE TRAITS Ideal For Men Fragrance Segment Luxury Fragrance Classification Eau de Toilette Fragrance Family Woody, Oriental Quantity 100 ml FRAGRANCE NOTES Top Note Coriander, Bitter Orange, Virginia Cedar Heart Note Saffron, Patchouli, Clove Base Note Amber, Cinnamon, Benzoin, Oak Moss|2200|1'),
(52, 8, 1, 'rtwu|Enabled|None|Benetton Blu|Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?|Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?|1015|1'),
(50, 6, 1, 'Evaflor|Enabled|None|Evaflor Whisky|Key Features Captivating Fragrance - Fresh, Crisp and Marine Scent Blend of Marine and Woody Notes Crafted for the man who knows to balance strength with sensitivity, Evaflor presents Whisky Silver, a perfume that matches his zest with some of its own. Captivating Fragrance A wafting scent that will keep you hooked to its lilting notes, the perfume has a fresh and crisp scent that is reminiscent of marine notes. Blend of Marine and Woody Notes The fragrance takes the bracing notes of marine origin and mingles it with the deep, dark tones of the woody notes to present an irresistible allure that will not fail you. Bottled in a classy flacon with a silver stopper, the Eau de Toilette is one that will draw attention without you even having to try.|FRAGRANCE TRAITS Ideal For Men Fragrance Classification Eau de Toilette Fragrance Family Aquatic, Woody Quantity 100 ml FRAGRANCE NOTES Top Note Citrus, Marine Heart Note Cyclamen, Freesia Base Note Moss, Wood, Musk|698|1'),
(49, 5, 1, 'Louis|Enabled|None|Louis Armand|Key Features Blend of Rose Absolute and Cinnamon Bold and Pleasing Fragrance Long-lasting The night lies heavily across the office as one single cubicle is lighted up and he sits there with one hand woven through his luxurious black hair and the other scribbling away to glory - he is a man who is driven by passion, one that knows no time, no reason and no needs. His resolve takes you by surprise with its strenght and his dedication to it makes you gape. For the man who is focussed on what he was and tunnels his vision down to the point where there exists only himself and his goal in the universe, Louis Armand presents Ultimate Drive, the fragrance of determination. The mass premium fragrance sharpens the edge of his desire to reach the end of the tunnel. Perfect for casual and formal wear, imagine the impact you will have as you stride into the room and every head turns to inhale the beautiful masculine notes of the Eau de Toilette. With bright and pointed opening notes with accords of mandarin orange, juicy grapefruit and light peppermint coloring the fragrance, Ultimate Drive gets off to a great start in its assault of your senses. The accords of rose absolute and spicy cinnamon color the heart notes which is sweet and soft. The dry down leaves behind a trail of warm leather, white wood, husky amber and patchouli which accentuates the blazing end of the fragrance. The singularly cut flacon of the fragrance reflects an asymmetric perfection that adds yet another facet to it. The golden tinged potion within is the mark of a man with many dimensions to his personality. Embrace the workaholic within you with Louis Armand Ultimate Drive, the fragrance of a man who knows exactly what he wants from life and sits back after a while to enjoy the fruits of his work.|FRAGRANCE TRAITS Ideal For Men Fragrance Segment Mass Premium Fragrance Classification Eau de Toilette Fragrance Family Woody Quantity 100 ml FRAGRANCE NOTES Top Note Mandarin Orange, Grapefruit, Peppermint Heart Note Rose Absolute, Cinnamon Base Note Leather, Patchouli, White Wood, Amber|500|1'),
(46, 2, 1, 'jaguar|Enabled|None|Jaguar Classic|Key Features Fresh and Sensuous Oriental-fougere Scents Expressive, Emphatically Masculine Fragrance Getting the contemporary men high with every whiff, Jaguar, introduces this fragrance that tingles through his senses. Oriental-Fougère Scents Comprising the goodness of oriental ingredients, this perfume spreads a oriental-fougère scents around. Expressive, Emphatically Masculine Fragrance This enticing fragrance is expressively and emphatically masculine. Fresh and Sensuous The fresh and sensuos aroma of Jaguar Classic Black Eau de Toilette uplifts the spirit of the trendy men.|The invigorating notes of this oriental fragrance perfectly portray a fresh,sensual masculinity.|1700|1'),
(47, 3, 1, 'david|Enabled|None|Davidoff Cool|Key Features Sharp and Flowery Fragrance Essence of Freshness, Sensuality and Natural Beauty Blend of Citrus, Pineapple and Woody Notes Scent of Pure Ocean Air Capturing the true essence of nature and purity of fresh water, this Cool Water Eau de Toilette from Davidoff is the iconic fragrance that defines your eminently feminine charm. Sharp and Flowery Fragrance The Davidoff Cool Water Eau de Toilette is the perfect mixture of extreme elegance and refinement exuded by its sharp and flowery fragrance. Essence of Freshness, Sensuality and Natural Beauty Enriched with sparkles of lavender and jasmine, this fragrance accentuates your natural beauty and sensual persona. Blend of Citrus, Pineapple and Woody Notes This perfume wraps you in fresh and enticing notes of citrus, pineapple and wood that last longer. Scent of Pure Ocean Air Taking inspiration from glistening water, this cool and breezy scent is a breath of pure ocean air.|FRAGRANCE TRAITS Ideal For Women Fragrance Segment Luxury Fragrance Classification Eau de Toilette Fragrance Family Aquatic Quantity 100 ml FRAGRANCE NOTES Top Note Peppermint, Lavender Heart Note Spicy Coriander, Jasmine, Sandalwood, Oak Moss, Geranium Base Note Musk, Amber|2100|1'),
(48, 4, 1, 'FRAGRANCE|Enabled|None|Calvin Klein|Key Features Sensuous with Woody Tones of Sandalwood and Amber Aromatic Fougere Fragrance - Fresh and Spicy Refreshing Yet Sexy Bringing about change in every note, this Eternity composition from Calvin Klein is a fragrance that leaves a timeless signature on every man so he radiates class and sophistication everywhere he travels sand not just in the concrete jungle. Aromatic Fougere Fragrance- Fresh and Spicy Taking you from the concrete jungle to one that is filled with a fresh and cool air is this perfume with a top note that constitutes hints of fresh citrus and intense spice. Refreshing Yet Sexy Throwing out the blanket of natural freshness, the EDT also ensures that your charismatic character proclaims your presence with an intense yet subtle sexiness, travelling with beautiful notes of this perfume to charm the world. Sensuous with Woody tones of Sandalwood and Amber Let your senses curl up in a ball amidst the warm tones of sandalwood and amber shredding the air with a burst of intensity. The sensuous amalgamation will all but leave the room in fire with its sexy understated style.|FRAGRANCE TRAITS Ideal For Men Fragrance Classification Eau de Toilette Fragrance Family Floral Quantity 100 ml FRAGRANCE NOTES Top Note Lemon, Bergamot, Petitgrain, Lavender Heart Note Juniperberry, Orange Blossom, Coriander, Lily of the Valley Base Note Rosewood, Amber, Sandal, Musk|2372|1'),
(45, 1, 1, 'adidas|Enabled|None|Adidas Ice|Key Features Fresh Ozonic Fragrance Long-lasting Fragrance upto 24 hours Ergonomic Shape to Fit in Hand Palm Developed with Athletes Fragrance Booster Technology Adidas introduces this perfume from its Ice Dive range that is apt for the athletic men who sport a ravishing and engaging personality. Fresh Ozonic Fragrance Wear this perfume and get absorbed in its fresh ozonic fragrance that sends ripples through your senses and rejuvenates you. Fragrance Booster Technology Emanating a soothing scent around, the urbane men will definitely walk with an air of confidence when they dab Ice Dive Eau de Toilette as it comes with a fragrance booster technology. Long-Lasting Fragrance Up To 24 hours Stay fresh all day long and enjoy every moment with vigor with this long-lasting fragrance that gives you 24 hours protection. Ergonomic Shape To Fit In Hand Palm Designed ergonomically and to perfection, this bottle’s shape fits in your palms without causing any discomfort. Developed With Athletes Adidas Ice Dive Eau de Toilette is designed keeping in mind the expectations of modern day athletes.|A spicy,sweet blend of citrus,greens and ambrosial notes,the casual chic of Ice dive from Adidas infuses your senses with a refreshing subtlety,perfect for a balmy summer.|699|0');
