INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(1, 4, 72, 0, 1, 'Key Features\r\nFresh Ozonic Fragrance\r\nLong-lasting Fragrance upto 24 hours\r\nErgonomic Shape to Fit in Hand Palm\r\nDeveloped with Athletes\r\nFragrance Booster Technology\r\nAdidas introduces this perfume from its Ice Dive range that is apt for the athletic men who sport a ravishing and engaging personality.\r\n\r\nFresh Ozonic Fragrance\r\n\r\nWear this perfume and get absorbed in its fresh ozonic fragrance that sends ripples through your senses and rejuvenates you.\r\n\r\nFragrance Booster Technology\r\n\r\nEmanating a soothing scent around, the urbane men will definitely walk with an air of confidence when they dab Ice Dive Eau de Toilette as it comes with a fragrance booster technology.\r\n\r\nLong-Lasting Fragrance Up To 24 hours\r\n\r\nStay fresh all day long and enjoy every moment with vigor with this long-lasting fragrance that gives you 24 hours protection.\r\n\r\nErgonomic Shape To Fit In Hand Palm\r\n\r\nDesigned ergonomically and to perfection, this bottle’s shape fits in your palms without causing any discomfort.\r\n\r\nDeveloped With Athletes\r\n\r\nAdidas Ice Dive Eau de Toilette is designed keeping in mind the expectations of modern day athletes.'),
(2, 4, 73, 0, 1, 'A spicy,sweet blend of citrus,greens and ambrosial notes,the casual chic of Ice dive from Adidas infuses your senses with a refreshing subtlety,perfect for a balmy summer.'),
(3, 4, 83, 0, 1, NULL),
(4, 4, 106, 0, 1, NULL),
(5, 4, 72, 0, 2, 'Key Features\r\nFresh and Sensuous\r\nOriental-fougere Scents\r\nExpressive, Emphatically Masculine Fragrance\r\nGetting the contemporary men high with every whiff, Jaguar, introduces this fragrance that tingles through his senses.\r\n\r\nOriental-Fougère Scents\r\n\r\nComprising the goodness of oriental ingredients, this perfume spreads a oriental-fougère scents around.\r\n\r\nExpressive, Emphatically Masculine Fragrance\r\n\r\nThis enticing fragrance is expressively and emphatically masculine.\r\n\r\nFresh and Sensuous\r\n\r\nThe fresh and sensuos aroma of Jaguar Classic Black Eau de Toilette uplifts the spirit of the trendy men.'),
(6, 4, 73, 0, 2, 'The invigorating notes of this oriental fragrance perfectly portray a fresh,sensual masculinity.'),
(7, 4, 83, 0, 2, NULL),
(8, 4, 106, 0, 2, NULL),
(9, 4, 72, 0, 3, 'Key Features\r\nSharp and Flowery Fragrance\r\nEssence of Freshness, Sensuality and Natural Beauty\r\nBlend of Citrus, Pineapple and Woody Notes\r\nScent of Pure Ocean Air\r\nCapturing the true essence of nature and purity of fresh water, this Cool Water Eau de Toilette from Davidoff is the iconic fragrance that defines your eminently feminine charm.\r\n\r\nSharp and Flowery Fragrance\r\n\r\nThe Davidoff Cool Water Eau de Toilette is the perfect mixture of extreme elegance and refinement exuded by its sharp and flowery fragrance.\r\n\r\nEssence of Freshness, Sensuality and Natural Beauty\r\n\r\nEnriched with sparkles of lavender and jasmine, this fragrance accentuates your natural beauty and sensual persona.\r\n\r\nBlend of Citrus, Pineapple and Woody Notes\r\n\r\nThis perfume wraps you in fresh and enticing notes of citrus, pineapple and wood that last longer.\r\n\r\nScent of Pure Ocean Air\r\n\r\nTaking inspiration from glistening water, this cool and breezy scent is a breath of pure ocean air.'),
(10, 4, 73, 0, 3, 'FRAGRANCE TRAITS\r\nIdeal For	Women\r\nFragrance Segment	Luxury\r\nFragrance Classification	Eau de Toilette\r\nFragrance Family	Aquatic\r\nQuantity	100 ml\r\nFRAGRANCE NOTES\r\nTop Note	Peppermint, Lavender\r\nHeart Note	Spicy Coriander, Jasmine, Sandalwood, Oak Moss, Geranium\r\nBase Note	Musk, Amber'),
(11, 4, 83, 0, 3, NULL),
(12, 4, 106, 0, 3, NULL),
(13, 4, 72, 0, 4, 'Key Features\r\nSensuous with Woody Tones of Sandalwood and Amber\r\nAromatic Fougere Fragrance - Fresh and Spicy\r\nRefreshing Yet Sexy\r\nBringing about change in every note, this Eternity composition from Calvin Klein is a fragrance that leaves a timeless signature on every man so he radiates class and sophistication everywhere he travels sand not just in the concrete jungle.\r\n\r\nAromatic Fougere Fragrance- Fresh and Spicy\r\nTaking you from the concrete jungle to one that is filled with a fresh and cool air is this perfume with a top note that constitutes hints of fresh citrus and intense spice.\r\n\r\nRefreshing Yet Sexy\r\nThrowing out the blanket of natural freshness, the EDT also ensures that your charismatic character proclaims your presence with an intense yet subtle sexiness, travelling with beautiful notes of this perfume to charm the world.\r\n\r\nSensuous with Woody tones of Sandalwood and Amber\r\nLet your senses curl up in a ball amidst the warm tones of sandalwood and amber shredding the air with a burst of intensity. The sensuous amalgamation will all but leave the room in fire with its sexy understated style.'),
(14, 4, 73, 0, 4, 'FRAGRANCE TRAITS\r\nIdeal For	Men\r\nFragrance Classification	Eau de Toilette\r\nFragrance Family	Floral\r\nQuantity	100 ml\r\nFRAGRANCE NOTES\r\nTop Note	Lemon, Bergamot, Petitgrain, Lavender\r\nHeart Note	Juniperberry, Orange Blossom, Coriander, Lily of the Valley\r\nBase Note	Rosewood, Amber, Sandal, Musk'),
(15, 4, 83, 0, 4, NULL),
(16, 4, 106, 0, 4, NULL),
(17, 4, 72, 0, 5, 'Key Features\r\nBlend of Rose Absolute and Cinnamon\r\nBold and Pleasing Fragrance\r\nLong-lasting\r\nThe night lies heavily across the office as one single cubicle is lighted up and he sits there with one hand woven through his luxurious black hair and the other scribbling away to glory - he is a man who is driven by passion, one that knows no time, no reason and no needs. His resolve takes you by surprise with its strenght and his dedication to it makes you gape. For the man who is focussed on what he was and tunnels his vision down to the point where there exists only himself and his goal in the universe, Louis Armand presents Ultimate Drive, the fragrance of determination. The mass premium fragrance sharpens the edge of his desire to reach the end of the tunnel. Perfect for casual and formal wear, imagine the impact you will have as you stride into the room and every head turns to inhale the beautiful masculine notes of the Eau de Toilette.\r\n\r\nWith bright and pointed opening notes with accords of mandarin orange, juicy grapefruit and light peppermint coloring the fragrance, Ultimate Drive gets off to a great start in its assault of your senses. The accords of rose absolute and spicy cinnamon color the heart notes which is sweet and soft. The dry down leaves behind a trail of warm leather, white wood, husky amber and patchouli which accentuates the blazing end of the fragrance. The singularly cut flacon of the fragrance reflects an asymmetric perfection that adds yet another facet to it. The golden tinged potion within is the mark of a man with many dimensions to his personality. Embrace the workaholic within you with Louis Armand Ultimate Drive, the fragrance of a man who knows exactly what he wants from life and sits back after a while to enjoy the fruits of his work.'),
(18, 4, 73, 0, 5, 'FRAGRANCE TRAITS\r\nIdeal For	Men\r\nFragrance Segment	Mass Premium\r\nFragrance Classification	Eau de Toilette\r\nFragrance Family	Woody\r\nQuantity	100 ml\r\nFRAGRANCE NOTES\r\nTop Note	Mandarin Orange, Grapefruit, Peppermint\r\nHeart Note	Rose Absolute, Cinnamon\r\nBase Note	Leather, Patchouli, White Wood, Amber\r\n'),
(19, 4, 83, 0, 5, NULL),
(20, 4, 106, 0, 5, NULL),
(21, 4, 72, 0, 6, 'Key Features\r\nCaptivating Fragrance - Fresh, Crisp and Marine Scent\r\nBlend of Marine and Woody Notes\r\nCrafted for the man who knows to balance strength with sensitivity, Evaflor presents Whisky Silver, a perfume that matches his zest with some of its own.\r\n\r\nCaptivating Fragrance\r\n\r\nA wafting scent that will keep you hooked to its lilting notes, the perfume has a fresh and crisp scent that is reminiscent of marine notes.\r\n\r\nBlend of Marine and Woody Notes\r\n\r\nThe fragrance takes the bracing notes of marine origin and mingles it with the deep, dark tones of the woody notes to present an irresistible allure that will not fail you.\r\n\r\nBottled in a classy flacon with a silver stopper, the Eau de Toilette is one that will draw attention without you even having to try.'),
(22, 4, 73, 0, 6, 'FRAGRANCE TRAITS\r\nIdeal For	Men\r\nFragrance Classification	Eau de Toilette\r\nFragrance Family	Aquatic, Woody\r\nQuantity	100 ml\r\nFRAGRANCE NOTES\r\nTop Note	Citrus, Marine\r\nHeart Note	Cyclamen, Freesia\r\nBase Note	Moss, Wood, Musk'),
(23, 4, 83, 0, 6, NULL),
(24, 4, 106, 0, 6, NULL),
(25, 4, 72, 0, 7, 'Key Features\r\nElegantly Simple Masculine Fragrance\r\nOriental Woody Fragrance\r\nIntense and Pungent Scent of Saffron\r\nFresh and Incisive Bitter Orange Scent\r\nSensual Warmth of Rich Amber\r\nBringing forth a burst of flavour into your life in a refreshing, invigorating way that adds an edge to your masculine persona, Silver Shadow from Davidoff is the perfect fragrance for the man who stands out without trying to.\r\n\r\nElegantly Simple\r\n\r\nThe Eau de Toilette brings a sheen of elegance while wrapping you up in an aura of masculine simplicity that lasts a long while.\r\n\r\nOriental Woody Fragrance\r\n\r\nA little spicy, a little edgy and a whole lot of deep dark tones constitute this perfume.\r\n\r\nSensual and Warm\r\n\r\nWith tones of resinous amber that adds depth and warmth to the concoction, the fragrance accentuates the latent sensuality that is primal.\r\n\r\nIntense and Pungent\r\n\r\nThe simplicity of saffron adds to the mixture a flavour that is far from frivolous.\r\n\r\nFresh and Incisive\r\n\r\nThe notes also contain bitter orange that is fresh and refreshing, lifting up sagging spirits.'),
(26, 4, 73, 0, 7, '\r\nFRAGRANCE TRAITS\r\nIdeal For	Men\r\nFragrance Segment	Luxury\r\nFragrance Classification	Eau de Toilette\r\nFragrance Family	Woody, Oriental\r\nQuantity	100 ml\r\nFRAGRANCE NOTES\r\nTop Note	Coriander, Bitter Orange, Virginia Cedar\r\nHeart Note	Saffron, Patchouli, Clove\r\nBase Note	Amber, Cinnamon, Benzoin, Oak Moss'),
(27, 4, 83, 0, 7, NULL),
(28, 4, 106, 0, 7, NULL),
(37, 4, 72, 0, 8, 'Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?'),
(38, 4, 73, 0, 8, 'Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?'),
(39, 4, 83, 0, 8, NULL),
(40, 4, 106, 0, 8, NULL),
(41, 4, 72, 0, 9, 'Key Features\r\nBlend of Cardamom, Elemi and Musk\r\nSpicy, Fruity and Floral Scent\r\nStrong and Refreshing\r\nCatching the fancy of a man with refined tastes, allowing his exuberant self to be crowned preeminent even as he serves a nine hour shift like everyone else is this Nike Fission EDT.\r\n\r\nSpicy, Fruity and Floral Scent \r\n\r\nShy yet assertive, the perfect swing of a mix that presents notes so spicy, fruity and floral so the EDT opens just as an undertone to your powerful nature.\r\n\r\nStrong and Refreshing\r\n\r\nYour need to be perfect and unique is quite a fresh breath just like the fragrance you wear because Nike’s mass premium comes from renowned perfumers to complement the best side in every man.\r\n        \r\nBlend of Cardamom, Elemi and Musk\r\n\r\nThe impeccability of the delicate opening lands on a bed of warm and intense musk blended with elemi and cardamom so even if people aren’t aware when you enter, their senses will know what you leave behind.'),
(42, 4, 73, 0, 9, 'Key Features\r\nBlend of Cardamom, Elemi and Musk\r\nSpicy, Fruity and Floral Scent\r\nStrong and Refreshing\r\nCatching the fancy of a man with refined tastes, allowing his exuberant self to be crowned preeminent even as he serves a nine hour shift like everyone else is this Nike Fission EDT.\r\n\r\nSpicy, Fruity and Floral Scent \r\n\r\nShy yet assertive, the perfect swing of a mix that presents notes so spicy, fruity and floral so the EDT opens just as an undertone to your powerful nature.\r\n\r\nStrong and Refreshing\r\n\r\nYour need to be perfect and unique is quite a fresh breath just like the fragrance you wear because Nike’s mass premium comes from renowned perfumers to complement the best side in every man.\r\n        \r\nBlend of Cardamom, Elemi and Musk\r\n\r\nThe impeccability of the delicate opening lands on a bed of warm and intense musk blended with elemi and cardamom so even if people aren’t aware when you enter, their senses will know what you leave behind.'),
(43, 4, 83, 0, 9, NULL),
(44, 4, 106, 0, 9, NULL),
(45, 4, 72, 0, 10, 'Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Men''s edition Davidoff Cool Water Into The Ocean for Men has been announced as fresh and aromatic, with accentuated sea accords. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Women''s edition Davidoff Cool Water Into The Ocean for Women highlights a floral-fruity blend refreshed with herbal notes. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Top notes await us with sea wave combined with citrusy zest of mandarin and luminous grapefruit. The heart incorporates sage and basil, leading to juniper in the base of the fragrance.'),
