(7, 4, 'simple', NULL, '2014-05-16 12:21:48', 1, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '4', 2, 'Davidoff Silver', NULL, NULL, 2200.0000, NULL, NULL, NULL, 0, NULL, '\r\nFRAGRANCE TRAITS\r\nIdeal For	Men\r\nFragrance Segment	Luxury\r\nFragrance Classification	Eau de Toilette\r\nFragrance Family	Woody, Oriental\r\nQuantity	100 ml\r\nFRAGRANCE NOTES\r\nTop Note	Coriander, Bitter Orange, Virginia Cedar\r\nHeart Note	Saffron, Patchouli, Clove\r\nBase Note	Amber, Cinnamon, Benzoin, Oak Moss', 'adee', NULL, '/d/a/davidoff_silver.jpeg', NULL, NULL, NULL, NULL, 0, '/d/a/davidoff_silver.jpeg', NULL, '2014-05-16 12:21:48', 'davidoff-silver', 'davidoff-silver.html', 4, 122.0000, NULL),
(8, 4, 'simple', NULL, '2014-05-17 13:18:21', 1, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '4', 2, 'Benetton Blu', '2014-05-06 00:00:00', '2014-05-30 00:00:00', 1015.0000, NULL, NULL, NULL, 0, NULL, 'Benetton Blu Man - freshness, cleanliness and the big blue of the sky and the ocean. This fragrance opens with lemon and lavender accords, a heart includes green notes of basil, rosemary oil and clary sage, while a base is flooded with waves of harmony combined of white cedar, patchouli and cocoa.?', 'rtwu', NULL, '/e/a/eau-de.jpeg', NULL, NULL, NULL, NULL, 0, '/e/a/eau-de.jpeg', NULL, '2014-05-17 13:18:21', 'benetton-blu', 'benetton-blu.html', 4, 100.0000, NULL),
(9, 4, 'simple', NULL, '2014-05-17 13:20:51', 1, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '4', 2, 'Nike Fission', NULL, NULL, 786.0000, NULL, NULL, NULL, 0, NULL, 'Key Features\r\nBlend of Cardamom, Elemi and Musk\r\nSpicy, Fruity and Floral Scent\r\nStrong and Refreshing\r\nCatching the fancy of a man with refined tastes, allowing his exuberant self to be crowned preeminent even as he serves a nine hour shift like everyone else is this Nike Fission EDT.\r\n\r\nSpicy, Fruity and Floral Scent \r\n\r\nShy yet assertive, the perfect swing of a mix that presents notes so spicy, fruity and floral so the EDT opens just as an undertone to your powerful nature.\r\n\r\nStrong and Refreshing\r\n\r\nYour need to be perfect and unique is quite a fresh breath just like the fragrance you wear because Nike’s mass premium comes from renowned perfumers to complement the best side in every man.\r\n        \r\nBlend of Cardamom, Elemi and Musk\r\n\r\nThe impeccability of the delicate opening lands on a bed of warm and intense musk blended with elemi and cardamom so even if people aren’t aware when you enter, their senses will know what you leave behind.', 'hsjk', NULL, '/n/i/nikefission.jpeg', NULL, NULL, NULL, NULL, 0, '/n/i/nikefission.jpeg', NULL, '2014-05-17 13:20:51', 'nike-fission', 'nike-fission.html', 4, 100.0000, NULL),
(10, 4, 'simple', NULL, '2014-05-17 13:23:54', 1, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '4', 2, 'Davidoff Cool Water', NULL, NULL, 1000.0000, NULL, NULL, NULL, 0, NULL, 'Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Men''s edition Davidoff Cool Water Into The Ocean for Men has been announced as fresh and aromatic, with accentuated sea accords. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Like every year, Davidoff celebrates its Cool Water editions with a new pair as variation of the theme of pleasant aquatic fragrances for men and women. The new fragrance will dive deep into the ocean and provide freshness and aromatic, sea notes.Women''s edition Davidoff Cool Water Into The Ocean for Women highlights a floral-fruity blend refreshed with herbal notes. Available as 125ml edt. Cool Water Into The Ocean for Men was launched in 2013.Top notes await us with sea wave combined with citrusy zest of mandarin and luminous grapefruit. The heart incorporates sage and basil, leading to juniper in the base of the fragrance.', 'sdfs', NULL, '/c/o/cool-water.jpeg', NULL, NULL, NULL, NULL, 2, '/c/o/cool-water.jpeg', NULL, '2014-05-17 18:22:06', 'davidoff-cool-water', 'davidoff-cool-water.html', 4, 122.0000, NULL),
