(1, 'Footer Links', 'footer_links', '<ul>\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2014-05-15 10:29:35', '2014-05-16 09:48:07', 0),
(2, 'Custom landing page 1', 'block_landing_page1', '<div class="landing-page nested-container">\n	<br />\n    \n	<div class="vertical-section grid12-4 persistent-grid2-1">\n        <a href="{{store direct_url="downloadable/ebooks.html"}}">\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/vert1.jpg"}}" alt="Sample banner" />\n            <div class="caption dark2 full-width">\n                <h2 class="heading permanent">Lorem</h2>\n                <p class="permanent">Nullam ornare enim nectis</p>\n                <p>Lorem ipsum dolor </p>\n            </div>\n        </a>\n	</div>\n	<div class="vertical-section grid12-4 persistent-grid2-1">\n        <a href="{{store direct_url="downloadable/music.html"}}">\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/vert2.jpg"}}" alt="Sample banner" />\n            <div class="caption dark2 full-width">\n	            <h2 class="heading permanent">Ipsum</h2>\n    	        <p class="permanent">In eget metus ornare itis est</p>\n        	    <p>Lorem ipsum dolor </p>\n            </div>\n        </a>\n	</div>\n	<div class="vertical-section grid12-4 persistent-grid2-1">\n        <a href="{{store direct_url="downloadable/software.html"}}">\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/vert3.jpg"}}" alt="Sample banner" />\n            <div class="caption dark2 full-width">\n	            <h2 class="heading permanent">Dolor</h2>\n    	        <p class="permanent">Etiam neque velit blandit sed</p>\n        	    <p>Lorem ipsum dolor </p>\n            </div>\n        </a>\n	</div>\n    <br />\n    \n	<div class="vertical-section grid-full">\n		{{block type="catalog/product_new" products_count="8" block_name="See Also: Recommended New Products" template="catalog/product/new.phtml"}}\n	</div>\n</div>', '2014-05-16 09:38:39', '2014-05-16 09:38:39', 1),
(3, 'Custom footer links 2', 'block_footer_links2', '<ul class="links hide-below-768">\r\n<li class="first"><a href="{{store direct_url="about-magento-demo-store/"}}">About Us</a></li>\r\n<li class="last"><a href="{{store direct_url="customer-service/"}}">Customer Service</a></li>\r\n</ul>', '2014-05-16 09:38:39', '2014-05-16 09:48:44', 0),
(4, 'Custom footer links', 'block_footer_links', '<ul class="links">\n\n    <li class="first">\n    	<a href="{{store url="catalog/seo_sitemap/category"}}" title="The Site Map">Site Map</a>\n    </li>\n    <li>\n    	<a href="{{store url="catalogsearch/term/popular"}}" title="Search Terms">Search Terms</a>\n    </li>\n    <li>\n    	<a href="{{store url="catalogsearch/advanced"}}" title="Advanced Search">Advanced Search</a>\n    </li>\n    <li>\n    	<a href="{{store url="sales/guest/form"}}" title="Orders and Returns">Orders and Returns</a>\n    </li>\n    <li>\n    	<a href="{{store url="contacts"}}" title="Contact Us">Contact Us</a>\n    </li>\n    <li class=" last">\n    	<a class="link-rss" href="{{store url="rss"}}" title="RSS">RSS</a>\n    </li>\n    \n</ul>', '2014-05-16 09:38:39', '2014-05-16 09:38:39', 0),
(5, 'Category above collection', 'block_category_above_collection', '<div class="sample-block">Static CMS block displayed above list/grid of products. Put your own content here.</div>', '2014-05-16 09:38:39', '2014-05-21 12:00:03', 0),
(6, 'Footer social', 'block_footer_primary_bottom_left', '<div class="social-links">\r\n<h4>Follow ShopUp</h4>\r\n<a class="first fb" title="Join us on Facebook" href="#"> <img src="{{media url="wysiwyg/infortis/ultimo/social/facebook.png"}}" alt="facebook" /> </a> <a class="twitter" title="Follow us on Twitter" href="#"> <img src="{{media url="wysiwyg/infortis/ultimo/social/twitter.png"}}" alt="twitter" /> </a> <a class="gplus" title="Join us on Google Plus" href="#"> <img src="{{media url="wysiwyg/infortis/ultimo/social/googleplus.png"}}" alt="google" /> </a></div>', '2014-05-16 09:38:39', '2014-05-16 09:58:12', 1),
(7, 'Footer payment', 'block_footer_payment', '<div class="float-left" style="margin-right: 100px;">\r\n<h4>VERIFIED BY :</h4>\r\n<p><img title="payment methods" src="{{skin url="images/payment-sprites.png"}}" alt="Payment methods" /></p>\r\n</div>\r\n<div class="float-left">\r\n<h4>PAY SECURELY BY :</h4>\r\n<p><img title="payment methods" src="{{skin url="images/footer-icon.png"}}" alt="Payment methods" /></p>\r\n</div>\r\n<div class="clear-both">&nbsp;</div>', '2014-05-16 09:38:39', '2014-05-16 09:58:41', 1),
(8, 'Category below collection', 'block_category_below_collection', '<div class="nested-container">\r\n<div class="page-banners clearer">\r\n<div class="grid12-6 banner"><a title="Replace this image with your own" href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/01.png"}}" alt="Sample banner" /> </a></div>\r\n<div class="grid12-6 banner"><a title="Replace this image with your own" href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/03.png"}}" alt="Sample banner" /> </a></div>\r\n</div>\r\n</div>', '2014-05-16 09:38:39', '2014-05-16 09:49:38', 0),
(9, 'Category above empty collection', 'block_category_above_empty_collection', '<p class="note-msg empty-catalog">There are no products matching the selection.</p>', '2014-05-16 09:38:39', '2014-05-21 12:00:24', 1),
(10, 'Product secondary column bottom', 'block_product_secondary_bottom', '<div class="feature indent first">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/one.png"}}" alt="" /></div>\r\n<p class="no-margin ">Return your items and get money back. <a href="#">Read more...</a></p>\r\n</div>\r\n<div class="feature indent">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/two.png"}}" alt="" /></div>\r\n<p class="no-margin ">Special offer: buy 2 and get 1 free. Every category available</p>\r\n</div>\r\n<div class="feature indent">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/three.png"}}" alt="" /></div>\r\n<p class="no-margin ">Buy this product and earn 10 special loyalty points</p>\r\n</div>\r\n<div class="feature indent last">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/four.png"}}" alt="" /></div>\r\n<p class="no-margin ">Call us for more info about our products</p>\r\n</div>', '2014-05-16 09:38:39', '2014-05-16 10:00:26', 0),
(11, 'Product primary column bottom (social links)', 'block_product_primary_bottom', 'Custom static blocks - put your own content here.', '2014-05-16 09:38:39', '2014-05-16 09:38:39', 0),
(12, 'Cart - below totals', 'block_cart_below_totals', '<div class="hide-below-320" style="display: table; float: right; padding-right: 10px; text-align: right;"><span style="display: table-cell; vertical-align: middle;">Sample info about SSL Certificate</span> <img title="Static CMS block displayed below totals. Put your own content here." src="{{media url="wysiwyg/infortis/ultimo/custom/block_cart_below_totals.png"}}" alt="Example Image" /></div>', '2014-05-16 09:38:39', '2014-05-16 10:01:10', 0),
(13, 'One page checkout  below progress', 'block_opc_below_progress', '<div class="sample-block">Custom CMS block displayed below the one page checkout progress block. Put your own content here.</div>', '2014-05-16 09:38:39', '2014-05-16 09:50:08', 0),
(14, 'Mini cart above products', 'block_mini_cart_above_products', '<div style="padding: 15px; background-color: #f5f5f5; color: #d90000;" title="Customizable CMS block for promo info"><a class="go" href="{{store url=""}}">Check our latest super promotions!</a></div>', '2014-05-16 09:38:40', '2014-05-16 10:01:32', 0),
(15, 'Custom Tab 1', 'block_product_tab1', '<p>Custom CMS block displayed as a tab. You can use it to display info about returns and refunds, latest promotions etc. You can put your own content here: text, HTML, images - whatever you like. There are <strong>many similar blocks</strong> accross the store. All CMS blocks are editable from the admin panel.</p>\r\n<div class="feature small indent first">\r\n<div class="icon list2 no-bg-color">&nbsp;</div>\r\n<p class="no-margin">Return your items and get your money back. <a href="#">More details</a></p>\r\n</div>\r\n<div class="feature small indent">\r\n<div class="icon list2 no-bg-color">&nbsp;</div>\r\n<p class="no-margin">Special offer: buy 2 and get 1 free. Every category available</p>\r\n</div>\r\n<div class="feature small indent last">\r\n<div class="icon list2 no-bg-color">&nbsp;</div>\r\n<p class="no-margin">Buy this product and earn 10 special loyalty points</p>\r\n</div>', '2014-05-16 09:38:40', '2014-05-16 09:50:38', 0),
(16, 'Custom Tab 2', 'block_product_tab2', '<p>Another custom CMS block displayed as a tab. You can use it to display info about returns and refunds, latest promotions etc. You can put your own content here: text, HTML, images - whatever you like. There are <strong>many similar blocks</strong> accross the store. All CMS blocks are editable from the admin panel.</p>\r\n<p>Lorem ipsum dolor sit, consectetur adipiscing elit. Etiam neque velit, blandit sed scelerisque quis. Nullam ornare enim nec justo bibendum lobortis. In eget metus.</p>', '2014-05-16 09:38:40', '2014-05-16 09:50:44', 0),
(17, 'Cart - below table', 'block_cart_below_table', '<div class="nested-container hide-below-768">\r\n<div class="page-banners clearer">\r\n<div class="grid12-6 banner"><a title="Static CMS block displayed below the cart. Put your own content here." href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/01.png"}}" alt="Sample banner" /> </a></div>\r\n<div class="grid12-6 banner"><a title="Static CMS block displayed below the cart. Put your own content here." href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/02.png"}}" alt="Sample banner" /> </a></div>\r\n</div>\r\n</div>', '2014-05-16 09:38:40', '2014-05-16 09:51:01', 0),
(18, 'Footer column 1', 'block_footer_column1', '<div class="feature first last"><img class="icon" src="{{media url="wysiwyg/infortis/ultimo/icons/info.png"}}" alt="" />\r\n<h6 class="heading">About Ultimo Theme</h6>\r\n<p class="text">Lorem ipsum dolor sit, consectetur adipiscing elit. Etiam neque velit, blandit sed scelerisque quis.</p>\r\n<p class="text">Nullam ornare enim nec justo bibendum lobortis. In eget metus.</p>\r\n<a class="go" href="http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis">Click to buy this theme</a></div>', '2014-05-16 09:38:40', '2014-05-16 09:51:12', 0),
(19, 'Footer column 2', 'block_footer_column2', '<div class="feature indent first">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/one.png"}}" alt="" /></div>\r\n<p class="no-margin ">Lorem ipsum dolor sit consectetur, adipiscing elit</p>\r\n</div>\r\n<div class="feature indent">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/two.png"}}" alt="" /></div>\r\n<p class="no-margin ">Etiam neque velit magento blanditsch ecommerce</p>\r\n</div>\r\n<div class="feature indent">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/three.png"}}" alt="" /></div>\r\n<p class="no-margin ">Scelerique qui responsive magento themes lorem</p>\r\n</div>\r\n<div class="feature indent last">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/four.png"}}" alt="" /></div>\r\n<p class="no-margin ">Nullam premium templates omar enim nec del rio</p>\r\n</div>', '2014-05-16 09:38:40', '2014-05-16 09:51:23', 0),
(20, 'Footer column 3', 'block_footer_column3', '<h6 class="heading">Something About Us</h6>\r\n<ul class="bullet">\r\n<li><a href="{{store direct_url="about-magento-demo-store/"}}">About Us</a></li>\r\n<li><a href="{{store direct_url="privacy-policy-cookie-restriction-mode/"}}">Privacy Policy</a></li>\r\n<li><a href="{{store direct_url="customer-service/"}}">Customer Service</a></li>\r\n<li><a href="#">Meat Our Best Partners</a></li>\r\n<li><a href="#">Our Other Projects</a></li>\r\n<li><a href="#">One Click To Join Us</a></li>\r\n<li><a href="#">Follow Us On Twitter</a></li>\r\n<li><a href="#">On Our Blog</a></li>\r\n</ul>', '2014-05-16 09:38:40', '2014-05-16 09:51:30', 0),
(21, 'Footer column 4', 'block_footer_column4', '<div class="feature indent first">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/phone.png"}}" alt="" /></div>\r\n<p class="no-margin ">Call Us +001 555 801<br />Fax +001 555 802</p>\r\n</div>\r\n<div class="feature indent">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/mobile.png"}}" alt="" /></div>\r\n<p class="no-margin ">+77 123 1234<br />+42 98 9876</p>\r\n</div>\r\n<div class="feature indent">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/email.png"}}" alt="" /></div>\r\n<p class="no-margin ">boss@example.com<br />me@example.com</p>\r\n</div>\r\n<div class="feature indent last">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/skype.png"}}" alt="" /></div>\r\n<p class="no-margin ">Skype: contact_us<br />skype_support</p>\r\n</div>', '2014-05-16 09:38:40', '2014-05-16 09:51:37', 0),
(22, 'Footer column 5', 'block_footer_column5', '<h6 class="heading">On Our Blog</h6>\n<ul>\n<li><a href="#">Premium Magento themes</a></li>\n<li><a href="#">Responsive theme</a></li>\n<li><a href="#">Latest news</a></li>\n<li><a href="#">All about our offer</a></li>\n<li><a href="#">About our new brands</a></li>\n<li><a href="#">New design</a></li>\n<li><a href="#">Join us on Facebook</a></li>\n<li><a href="#">On our blog</a></li>\n</ul>', '2014-05-16 09:38:40', '2014-05-16 09:38:40', 0),
(23, 'Footer column 6', 'block_footer_column6', '<h6 class="heading">Sample Column</h6>\n<ul>\n<li><a href="#">Responsive Magento Theme</a></li>\n<li><a href="#">Magento Extensions</a></li>\n<li><a href="#">Store Overview</a></li>\n<li><a href="#">Buy This</a></li>\n<li><a href="#">Sample Link</a></li>\n<li><a href="#">Some Other Link</a></li>\n<li><a href="#">Link Example</a></li>\n</ul>', '2014-05-16 09:38:40', '2014-05-16 09:38:40', 0),
(24, 'Custom Block', 'block_header_nav_dropdown', '<div class="grid12-3">\r\n<h3 class="heading">Responsive Magento Theme</h3>\r\n<p>Ultimo is a premium Magento theme with advanced admin module. It''s extremely customizable and fully responsive. Can be used for every type of store.</p>\r\n<a style="color: red;" href="http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis">Buy this Magento theme</a></div>\r\n<div class="grid12-3"><img src="{{media url="wysiwyg/infortis/ultimo/custom/1.jpg"}}" alt="Example" />\r\n<h5 class="heading">Editable image size</h5>\r\n<p>Size of product image and thumbnails on product page editable from admin panel. Specify any size you like, images don''t have to be square - keep the aspect ratio.</p>\r\n<a href="{{store direct_url="ultimo-responsive-magento-theme"}}">More details</a></div>\r\n<div class="grid12-3"><img src="{{media url="wysiwyg/infortis/ultimo/custom/2.jpg"}}" alt="Example" />\r\n<h5 class="heading">Brand logo on product page</h5>\r\n<p>It can also be a link to any page, e.g. link to a category with products from that brand, link to the search results or any CMS page (editable from admin panel).</p>\r\n<a href="{{store direct_url="ultimo-responsive-magento-theme"}}">More details</a></div>\r\n<div class="grid12-3"><img src="{{media url="wysiwyg/infortis/ultimo/custom/3.jpg"}}" alt="Example" />\r\n<h5 class="heading">Sliders for Up-sell and Related</h5>\r\n<p>There are sliders in Up-sell Products and Related Products blocks (visible if there are to many products). Now you can select as much related and up-sell products as you want,</p>\r\n<a href="{{store direct_url="ultimo-responsive-magento-theme"}}">More details</a></div>', '2014-05-16 09:38:40', '2014-05-16 09:51:48', 0),
(25, 'CMS page top', 'block_cms_page_top', '<div class="nested-container">\n\n    <div class="page-banners clearer">\n        <div class="grid12-6 banner">\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/01.png"}}" alt="Sample banner" />\n            </a>\n        </div>\n        <div class="grid12-6 banner">\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/02.png"}}" alt="Sample banner" />\n            </a>\n        </div>\n\n    </div>\n\n</div>', '2014-05-16 09:38:41', '2014-05-16 09:38:41', 0),
(26, 'Product replace related', 'block_product_replace_related', '<div class="block">\r\n<div class="block-title"><strong><span>Replace related</span></strong></div>\r\n<p style="background-color: #eee; padding: 10px; margin-bottom: 10px; margin-top: 10px;">Custom CMS block replacing related products. Put your own content here: text, HTML, images - whatever you want.</p>\r\n<p style="background-color: #eee; padding: 10px;">There are many similar blocks accross the store. All editable from admin panel.</p>\r\n</div>', '2014-05-16 09:38:41', '2014-05-16 09:52:09', 0),
(27, 'Product replace up-sell', 'block_product_replace_upsell', '<div class="sample-block">Custom CMS block displayed when you want to replace up-sell products with custom content. You can put here simple text, images, HTML or whatever you like.</div>', '2014-05-16 09:38:41', '2014-05-16 09:52:18', 0),
(28, 'Header links upper', 'block_header_links_upper', '<div class="show-separators">\r\n<ul class="links">\r\n<li class="first hide-below-480"><a href="javascript:void(0);">Free Shipping*</a></li>\r\n<li class="hide-below-960"><a href="javascript:void(0);">Cash on Delivery</a></li>\r\n<li class="hide-below-768"><a href="javascript:void(0);">30 Days-Return</a></li>\r\n<li class="last hide-below-480"><a href="javascript:void(0);">Customer Support(24x7)</a></li>\r\n</ul>\r\n</div>', '2014-05-16 09:38:41', '2014-05-21 12:01:16', 1),
(29, 'Header top help', 'block_header_top_help', '<div class="hide-below-768 phone" title="Customer Support">Call Us +001 555 801</div>', '2014-05-16 09:38:41', '2014-05-21 12:01:26', 1),
(30, 'Right sidebar top', 'block_right_top', '<div class="block">\r\n<div class="block-title"><strong><span>Right Top Block</span></strong></div>\r\n<p style="background-color: #f5f5f5; color: #666; padding: 10px; margin-bottom: 10px; margin-top: 10px;">Custom CMS block displayed at the top of the right sidebar. Put your own content here: text, HTML, images - whatever you like.</p>\r\n<p style="background-color: #f5f5f5; color: #666; padding: 10px;">There are many similar content placeholders across the store. All editable from admin panel.</p>\r\n</div>', '2014-05-16 09:38:41', '2014-05-16 09:52:30', 0),
(31, 'Custom Top Links (to replace Magento''s default Top Links)', 'block_header_top_links', '<ul class="links">\n\n	<li class="first">\n		<a href="{{store url="customer/account"}}" title="Customer Account">Custom</a>\n	</li>\n	<li>\n		<a href="{{store url="wishlist"}}" title="Wishlist">Wishlist</a>\n	</li>\n	<li>\n		<a href="{{store url="customer/account/login"}}" title="Log In">Log In</a>\n	</li>\n	<li class="last">\n		<a href="{{store url="customer/account/create"}}" title="Sign Up">Sign Up</a>\n	</li>\n\n</ul>', '2014-05-16 09:38:41', '2014-05-16 09:38:41', 0),
(32, 'Custom Top Links 2', 'block_header_top_links2', '<ul class="links">\n\n	<li class="separator-left">\n		<a href="{{store url="about-magento-demo-store"}}" title="Custom link">Custom Link</a>\n	</li>\n	<li class="separator-left hide-below-768">\n		<a href="{{store url="any/custom/page"}}" title="Link Hidden on Mobile">Desktop Link</a>\n	</li>\n\n</ul>', '2014-05-16 09:38:41', '2014-05-16 09:38:41', 0),
(33, 'Left sidebar top', 'block_left_top', '<div class="block">\r\n<div class="block-title"><strong><span>Custom Block - Top</span></strong></div>\r\n<p style="background-color: #f5f5f5; color: #666; padding: 10px; margin-bottom: 10px; margin-top: 10px;">Custom CMS block displayed in the sidebar. Put your own content here: text, HTML, images etc.</p>\r\n<p style="background-color: #f5f5f5; color: #666; padding: 10px; margin-bottom: 10px; margin-top: 10px;">There are <strong>many similar blocks</strong> across the store. All editable from admin panel.</p>\r\n</div>', '2014-05-16 09:38:41', '2014-05-16 09:53:07', 0),
(34, 'Left sidebar bottom', 'block_left_bottom', '<div class="block">\r\n<div class="block-title"><strong><span>Custom Block - Bottom</span></strong></div>\r\n<div class="block-content sample-block">\r\n<p>Custom CMS block displayed in the sidebar below the other blocks. Put your own content here.</p>\r\n</div>\r\n<div class="block-content sample-block">\r\n<p>There are many similar content placeholders across the store. All editable from admin panel.</p>\r\n</div>\r\n</div>', '2014-05-16 09:38:41', '2014-05-16 09:53:19', 0),
