(36, 'Footer - row 2 column 1', 'block_footer_row2_column1', '<h6 class="heading">Service</h6>\r\n<ul class="bullet">\r\n<li><a href="{{store url="path/to/page"}}">About</a></li>\r\n<li><a href="{{store url="path/to/page"}}">Contact Us</a></li>\r\n<li><a href="{{store url="path/to/page"}}">Terms and Conditions</a></li>\r\n<li><a href="{{store url="path/to/page"}}">Privacy Policy</a></li>\r\n<li><a href="{{store url="path/to/page"}}">Affiliate Program</a></li>\r\n</ul>', '2014-05-16 09:38:42', '2014-05-16 10:03:13', 1),
(37, 'Footer - row 2 column 2', 'block_footer_row2_column2', '<h6 class="heading">Our Policies</h6>\r\n<ul class="bullet">\r\n<li><a href="{{store url="path/to/page"}}">Cancellations and Returns</a></li>\r\n<li><a href="{{store url="path/to/page"}}">Shipping</a></li>\r\n<li><a href="{{store url="path/to/page"}}">Payments</a></li>\r\n<li><a href="{{store url="path/to/page"}}">Ordering and Tracking</a></li>\r\n</ul>', '2014-05-16 09:38:42', '2014-05-16 10:03:39', 1),
(38, 'Footer - row 2 column 3', 'block_footer_row2_column3', '<h6 class="heading">Shop</h6>\r\n<ul class="bullet">\r\n<li><a href="#">New Arrivals</a></li>\r\n<li><a href="#">Men</a></li>\r\n<li><a href="#">Women</a></li>\r\n<li><a href="#">Sale</a></li>\r\n</ul>', '2014-05-16 09:38:42', '2014-05-16 10:04:20', 1),
(39, 'Footer - row 2 column 5', 'block_footer_row2_column5', '<h6 class="heading">Fifth Heading</h6>\n<ul class="bullet">\n<li><a href="{{store url="path/to/page"}}">Sample Link</a></li>\n<li><a href="{{store url="path/to/page"}}">Some Other Link</a></li>\n<li><a href="{{store url="path/to/page"}}">Link Example</a></li>\n</ul>', '2014-05-16 09:38:42', '2014-05-16 09:38:42', 0),
(40, 'Footer - row 2 column 6', 'block_footer_row2_column6', '<h6 class="heading">Sixth Heading</h6>\n<ul class="bullet">\n<li><a href="{{store url="path/to/page"}}">Sample Link</a></li>\n<li><a href="{{store url="path/to/page"}}">Some Other Link</a></li>\n<li><a href="{{store url="path/to/page"}}">Link Example</a></li>\n</ul>', '2014-05-16 09:38:42', '2014-05-16 09:38:42', 0),
(41, 'Footer - row 2 column 4', 'block_footer_row2_column4', '<div class="feature indent first">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/phone.png"}}" alt="" /></div>\r\n<p class="no-margin ">Call Us +001 555 801<br />Fax +001 555 802</p>\r\n</div>\r\n<div class="feature indent">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/mobile.png"}}" alt="" /></div>\r\n<p class="no-margin ">+77 123 1234<br />+42 98 9876</p>\r\n</div>\r\n<div class="feature indent">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/email.png"}}" alt="" /></div>\r\n<p class="no-margin ">boss@example.com<br />me@example.com</p>\r\n</div>\r\n<div class="feature indent last">\r\n<div class="icon"><img src="{{media url="wysiwyg/infortis/ultimo/icons/skype.png"}}" alt="" /></div>\r\n<p class="no-margin ">Skype: contact_us<br />skype_support</p>\r\n</div>', '2014-05-16 09:38:42', '2014-05-16 10:04:44', 1),
(42, 'Custom landing page 2', 'block_landing_page2', '<div class="landing-page">\r\n<p class="horizontal-section sample-block">This is a custom landing page with sidebar: a CMS block which can replace category products. You can put your own content here: text, HTML, images - whatever you want. You can create landing page for every category.</p>\r\n<a class="horizontal-section" title="Replace this image with your own content." href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/infortis/ultimo/custom/landing/horiz1.jpg"}}" alt="Sample Image" /> </a> <a class="horizontal-section" title="Replace this image with your own content." href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/infortis/ultimo/custom/landing/horiz2.jpg"}}" alt="Sample Image" /> </a> <a class="horizontal-section" title="Replace this image with your own content." href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/infortis/ultimo/custom/landing/horiz3.jpg"}}" alt="Sample Image" /> </a></div>', '2014-05-16 09:38:42', '2014-05-16 10:05:03', 0),
