(45, 'Home slide 3', 'block_slide3', '<p><a href="{{store url="> <img src="{{media url="wysiwyg/infortis/ultimo/slideshow/03.jpg"}}" alt="Sample slide" /></a></p>\r\n<div class="caption dark3">\r\n<h2 class="heading permanent">Sample Caption</h2>\r\n<p>Etiam neque velit, blandit sed scelerisque quis. Lorem ipsum.</p>\r\n<p>Lorem ipsum dolor sit amet consectetur</p>\r\n</div>\r\n<div class="caption dark1 top-right">\r\n<h2 class="heading permanent">Sample Caption</h2>\r\n<p>Nullam ornare enim nec justo bibendum lobortis metus</p>\r\n</div>', '2014-05-16 09:38:42', '2014-05-16 09:54:32', 0),
(46, 'Custom landing page 3 - category banner', 'block_landing_page3', '<div class="horizontal-section"><a href="{{store direct_url=''#''}}"> <img title="You can edit this block or replace it with custom content" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/category01.jpg"}}" alt="Sample banner" /></a>\r\n<div class="caption light2 full-width">\r\n<h2 class="heading permanent">Category Banner</h2>\r\n<p>Upload image and description for every category in the store</p>\r\n<p>Create custom category blocks</p>\r\n</div>\r\n</div>', '2014-05-16 09:38:42', '2014-05-16 09:53:51', 0),
