INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '<div class="page-title"><h1>Whoops, our bad...</h1></div>\r\n<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class="disc">\r\n<li><a href="#" onclick="history.go(-1); return false;">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a> <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li></ul></dd></dl>\r\n', '2014-05-15 10:29:35', '2014-05-15 10:29:35', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'two_columns_right', NULL, NULL, 'home', NULL, '<div class="flexi-banner">\r\n<div class="nested-container">\r\n<div class="page-banners clearer">\r\n<div class="grid12-8 banner"><a title="Replace this image with your own" href="{{store direct_url="more/jackets.html"}}"> <img src="{{media url="wysiwyg/prod1.jpg"}}" alt="Sample banner" /> </a></div>\r\n<div class="grid12-4 banner"><a title="Replace this image with your own" href="{{store direct_url="kurtis.html"}}"> <img src="{{media url="wysiwyg/prod2.jpg"}}" alt="Sample banner" /></a></div>\r\n</div>\r\n</div>\r\n<div class="nested-container">\r\n<div class="page-banners clearer">\r\n<div class="grid12-4 banner"><a title="Replace this image with your own" href="{{store direct_url="share-and-earn-reward-points"}}"> <img src="{{media url="wysiwyg/prod3.jpg"}}" alt="Sample banner" /> </a></div>\r\n<div class="grid12-8 banner"><a title="Replace this image with your own" href="{{store direct_url="about_brand"}}"> <img src="{{media url="wysiwyg/prod4.jpg"}}" alt="Sample banner" /> </a></div>\r\n</div>\r\n<div id="gridBlock" class="">\r\n<div class="page-banners clearer">\r\n<div class="grid12-4 banner"><a title="Replace this image with your own" href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/prod5.jpg"}}" alt="Sample banner" /> </a></div>\r\n<div class="grid12-4 banner"><a title="Replace this image with your own" href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/prod6.jpg"}}" alt="Sample banner" /> </a></div>\r\n<div class="grid12-4 banner"><a title="Replace this image with your own" href="{{store direct_url="about-magento-demo-store"}}"> <img src="{{media url="wysiwyg/prod7.jpg"}}" alt="Sample banner" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>{{block type="ultimo/product_list_featured" category_id="27" product_count="8" is_random="0" hide_button="1" block_name="RECOMMENDED FOR YOU" template="catalog/product/list_featured_slider.phtml"}}</p>', '2014-05-15 10:29:35', '2014-06-15 01:40:48', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
